import React, { useEffect, useState } from 'react';
import Card from "./Card";

const Home = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbzAk3DWTrYtZwCKKtrGhAtc1Au70cV_bxIoTMv8JbK_mv6lFH1ZUPPcJymtE6F8KjJF/exec')
            .then(response => response.json())
            .then(data => setData(data));
    }, []);

    return (
        <div className="home">
            <div className="section">
                <h1>Top Reviews</h1>
                <div className="gallery">
                    {data.map((item, i) => (
                        <div className="card" key={i}>
                            <img src={item.image} />
                            <div className="card-details">
                                <h2 className="gold">{item.title}</h2>
                                <h4 className="beige">{item.artist}</h4>
                                <p className="tan">reviewed by {item.author}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
            <hr />
        </div>
    );
}

export default Home;
